    super(props);

    document.body.addEventListener("keydown",(e)=>{
        if(e.keyCode == 13){
            //enter key pressed
            this.sendmessage();
        }
    })

  }

  sendmessage = () => {
      console.log('send')
  }


  render(){
    return(
      <div className="messagePageWrapper">
          <button id='backbuttonmessages'>Back</button>
